e editing products.','{}','unactioned','woocommerce.com','2023-05-21 13:38:37',NULL,0,'plain','',0,0,'info'),(80,'woocommerce-WCstripe-May-2023-updated-needed','update','en_US','Action required: Security update of WooCommerce Stripe plugin','<strong>Your store requires a security update for the WooCommerce Stripe plugin</strong>. Please update the WooCommerce Stripe plugin immediately to address a potential vulnerability.','{}','pending','woocommerce.com','2023-06-05 11:15:11',NULL,0,'plain','',0,0,'info'),(81,'woocommerce-WCReturnsWarranty-June-2023-updated-needed','update','en_US','Action required: Security update of WooCommerce Returns and Warranty Requests extension','<strong>Your store requires a security update for the Returns and Warranty Requests extension</strong>.  Please update to the latest version of the WooCommerce Returns and Warranty Requests extension immediately to address a potential vulnerability discovered on May 31.','{}','pending','woocommerce.com','2023-06-05 11:15:11',NULL,0,'plain','',0,0,'info'),(82,'woocommerce-WCSubscriptions-June-2023-updated-needed','marketing','en_US','Action required: Security update of WooCommerce Subscriptions','<strong>Your store requires a security update for the WooCommerce Subscriptions plugin</strong>. Please update the WooCommerce Subscriptions plugin immediately to address a potential vulnerability.','{}','pending','woocommerce.com','2023-06-06 08:16:43',NULL,0,'plain','',0,0,'info'),(83,'woocommerce-WCPayments-June-2023-updated-needed','update','en_US','Action required: Security update of WooCommerce Payments','<strong>Your store requires a security update for the WooCommerce Payments plugin</strong>. Please update the WooCommerce Payments plugin immediately to address a potential vulnerability.','{}','pending','woocommerce.com','2023-06-07 08:53:56',NULL,0,'plain','',0,0,'info'),(84,'woocommerce_hpos_1st_notification_q2_2023','marketing','en_US','High-Performance Order Storage (HPOS) is on its way','Our team is targeting August 2023 to roll out a major database upgrade that can unlock faster checkout and order creation for your customers — and lightning-quick order lookup for you. Enablement is optional and you won’t be forced to update, but read on to see why this was our most requested new feature.','{}','unactioned','woocommerce.com','2023-06-07 08:53:56',NULL,0,'plain','',0,0,'info'),(85,'wc-admin-orders-milestone','info','en_US','Congratulations on processing 10 orders!','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.','{\"current_milestone\":10}','unactioned','woocommerce-admin','2023-06-07 12:55:22',NULL,0,'plain','',0,0,'info'),(86,'woocommerce-WCOPC-June-2023-updated-needed','update','en_US','Action required: Security update of WooCommerce One Page Checkout','<strong>Your shop requires a security update to address a vulnerability in the WooCommerce One Page Checkout extension</strong>. The fix for this vulnerability was released for this extension on June 13th. Please update immediately.','{}','pending','woocommerce.com','2023-06-23 08:13:03',NULL,0,'plain','',0,0,'info');
